import React from "react";


import { Grommet, Box, DataTable,Meter, Text } from "grommet";
import { grommet } from "grommet/themes";

import { useQuery } from '@apollo/client';
import { BOOKINFO } from './Query'


const columns = [
    {
      property: 'id',
      header: 'ID',
      primary: true,
    },
    {
      property: 'title',
      header: 'Title',
    },
    {
      property: 'author',
      header: 'Author',


    },
    {
      property: 'Carbs',
      header: 'Carbs',
    }
  ];



 const { data } = useQuery(BOOKINFO)
  export default function DataTabletest() {
      return (
        <Grommet>
          <Box align='center'>
            <DataTable resizeable='true' sortable='true' size='small' columns={columns} data={data} />
          </Box>
        </Grommet>
      );
    }
